import React, { useRef, useState } from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import 'swiper/css/pagination';
import 'swiper/css/navigation';
import './Footer.css';
import { Navigation, Pagination, Mousewheel, Keyboard } from 'swiper';
import FooterImg from '../../img/FooterImg.jpg'
import FooterImg2 from '../../img/FooterImg2.jpg'



export default function App() {
    return (
        <>
            <Swiper
                cssMode={true}
                navigation={true}
                pagination={true}
                mousewheel={true}
                keyboard={true}
                modules={[Navigation, Pagination, Mousewheel, Keyboard]}
                className="mySwiper"
            >
                <SwiperSlide className='SwiperSlide1'>
                <h1>Mamnun mijozlar fikri</h1>
       <div className='Swiperslideh3'> 
       <h3 className='swiper_h3'>"Yuksalish Liderlar akademiyasining boshlang`ich 2 oy
       <br/>davomida juda ko`plab qiyinchiliklarga duch keldik,
       <br/>moliyaviy hisob-kitob, kengayish va filiallarni tizimli
       <br/>boshqarishda juda qiynaldik. Va nihoyat jonimizga aro
       <br/>kirgan platforma keldi, buning nomi Modme deb ataladi.
       <br/>Ushbu platformani ishlatish orqali ishimiz oson ko`chdi".
        <div className='ugvey'>
       <img className='swi' src={swiperimg1}/>
       </div>
       <h6><h5 className='familiyatext1'>MuhammadAli Eshonqulov</h5>
       Yuksalish liderlar akademiyasi asoschisi</h6>
       </h3> 

       </div>       
                </SwiperSlide>
                <SwiperSlide>Slide 2</SwiperSlide>
                <SwiperSlide>Slide 3</SwiperSlide>
                <SwiperSlide>Slide 4</SwiperSlide>
                <SwiperSlide>Slide 5</SwiperSlide>
                <SwiperSlide>Slide 6</SwiperSlide>
                <SwiperSlide>Slide 7</SwiperSlide>
                <SwiperSlide>Slide 8</SwiperSlide>
                <SwiperSlide>Slide 9</SwiperSlide>
            </Swiper>
        </>
    );
}
